    };
  iterLength=-1;
  for (var i=numberOfObjects-1; i>=0; i--) {if (!skipBuilding[i]) {iterLength=i; break}}
  if (iterLength>=0) BinaryLoop(iterLength)
  for (var i = 0; i < numberOfObjects; i++) {
